context_page_description:
Hoàng hậu Sri Suriyendra là Hoàng hậu của Xiêm, vợ của Phutthaloetla Naphalai, là người anh em họ của mình, và mẹ của Mongkut và Pinklao. Cô sau đó được đặt tên sau khi đăng quang của con trai bà Mongkut như Krom Somdet Phra Sri Suriyendramataya.
Công chúa Bunrot là con gái của công chúa Sri Sudarak và chồng Trung Quốc bà Ngoen Saetan. Công chúa Bunrot sống với mẹ trong cung điện lớn và lớn lên cùng với người anh em họ nữ từ mẫu của Mẹ, các con gái của Phutthayotfa Chulalok.
Công chúa Bunrot đã ngoại tình với người em họ của mình, Hoàng tử Isarasundhorn, một đứa con trai và là người thừa kế rõ ràng cho Vua Phutthayotfa Chulalok. Năm 1801, nhà vua phát hiện ra công chúa 'bốn tháng mang thai và bị trục xuất cô khỏi cung điện lớn để sống với anh trai Hoàng tử Thepharirak. Hoàng tử Isarasundhorn năn nỉ cha mình không có kết quả để trả lại công chúa về cung điện. Các cặp vợ chồng cuối cùng định cư tại cung điện cũ và công chúa Bunrot trở thành vị phối ngẫu của hoàng tử. Em bé đã chết, tuy nhiên, ngay sau khi sinh. Với Hoàng tử Isarasundhorn, cô sinh ba con trai:
Đứa con đầu lòng của bà, sinh năm 1801, đã chết ngay sau khi sinh;
Hoàng tử Mongkut, hoặc sau đó Vua Mongkut, sinh năm 1804;
